import React from 'react'
import './Footer.css'

const Footer = () => {
  return (
    <div className='f-wrapper'>
       
       <div className='flexStart paddings'>
                <img src="./Foodian_logo.png" alt="logo" width={100}/>
                <p>Foodian</p>
            </div>
    </div>
  )
}

export default Footer
